[idle_timeout]
timeout: 1800

[safe_z_home]
home_xy_position: 150,149
z_hop: 10

##  Use QUAD_GANTRY_LEVEL to level a gantry.
[quad_gantry_level]

gantry_corners:
   -59,0
   361,380
##  Probe points
points:
   25,25
   25,250
   275,250
   275,25

speed: 200
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.005
